import React from 'react';


const PostForm = ()=>{
    return (
        <div className="ui form">
            <div className="field">
                <label>Post Title</label>
                <input type="text"/>
            </div>
            <div className="field">
                <label>Post Content</label>
                <textarea rows="3"></textarea>
            </div>
            <button className="ui primary button">
                Send
            </button>
            <button className="ui button">
                Cancel
            </button>
        </div>
            );
};

export default PostForm;
